async function showMint() {
    console.log('showmint')
    $(".connect-page").hide()
    $(".mint-page").show()
    gamePhase = GamePhase.MINT
    console.log('GamePhase: MINT')
    $("div.connect-page").hide()
    $("div.mint-page").show()
    if (isChosenOne) {
        $(".not-chosen-prompt").hide()
        $(".chosen-prompt").show()
    } else {
        $(".not-chosen-prompt").show()
        $(".chosen-prompt").hide()
    }
}

$(document).ready(function () {
    $("button.connect").click(connect)
    $(".mint-text.minus").click(mintMinus)
    $(".mint-text.plus").click(mintPlus)
    $("button.mint").click(mint)
    $("img.opensea-button").click(function() {
        window.open(openSeaUrl + spellSlugName, '_blank');
    })
    ToastTemplate = $($("#toast-template").html())
    connect()
})


